description:
Avenza Geographic Imager for Photoshop.

Working with raster imagery doesnt have to be complicated. Geographic Imager enhances Adobe Photoshop to make working with spatial imagery quick and efficient. It adds tools to import, edit, manipulate and export geospatial images such as aerial and satellite imagery. Enjoy the use of native Adobe Photoshop functions such as transparencies, filters, pixel editing, and image adjustments like brightness, contrast, and curve controls while maintaining spatial referencing. Geographic Imager supports GeoTIFF in Adobe Photoshop and other industry standard raster formats. Mosaic and tile images, change projections, transform, rectify and georeference images based on ground control points. Batch-process your imagery using Geographic Imager and Adobe Photoshop scripting capabilities.

